  const doEquipItem = (attributes,sections,iSectionID,iMult) => {
      let theArmorValue = attributes[iSectionID+'_armorvalue'];
      let theMovePen = attributes[iSectionID+'_movepen'];
      let theEffects = attributes[iSectionID+'_effects'];
      let theOk = 0; //all ok
      let theArea = [];
      let theUpdate = [];
      let theField = '';
      let theValue = 0;
  
      theArmorValue = theArmorValue*iMult;
      theMovePen = theMovePen*iMult;
  
      if (theArmorValue!==0) {
          attributes['chaosseed-combatstats-armorvalue-equipbonus'] += theArmorValue;
      };
  
      if (theMovePen!==0) {
          attributes['chaosseed-movement-movepenalty-equipbonus'] += theMovePen;
      };
  
      if (theEffects!=='') {
          //process each line
          const lines = theEffects.split('\n');
          for(var i = 0;i < lines.length;i++) {
              const theArea = lines[i].split('.');
              theUpdate = theArea[1].split('+');
              if (theUpdate.length===0)  {
                  theUpdate = theArea[1].split('-');
              };
  
              if (theUpdate.length>0) {
                  theField = theUpdate[0];
                  theValue = parseInt(theUpdate[1])*iMult;
              } else {
                  doWriteLog(attributes,sections,'error parsing effects'+theEffects);
                  theOk = -1;
              }
  
              if (theOk===0) {
                  const theZone = theArea[0];
                  const theFieldID = getFieldID(idChaosSeed,theZone,theZone,idEquipBonus,theField);
                  attributes[theFieldID] += theValue;
              }
          }
      }
      attributes['inventory-totweight'] = calcTotWeightInventory({attributes,sections});
  
      return theOk;
  };
  k.registerFuncs({doEquipItem});
  
